import React from 'react';

const UsuarioEntrada = (props) => {
  const inputStyle = {
    margin: '0 auto', // Isso centraliza o elemento horizontalmente
  };

  return (
    <input
      type="text"
      placeholder="Digite um nome"
      onChange={props.onChange}
      style={inputStyle}
    />
  );
};


export default UsuarioEntrada;
